import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import EventList from '../EventList'; // Import your EventList component
import AddEventForm from '../AddEventForm'; // Import your AddEventForm component
import EditEventForm from './EditEventForm'; // Import your EditEventForm component
// Assume DeleteEvent functionality is handled within EventList or EditEventForm

function App() {
  return (
    <BrowserRouter>
      <div>
        <h1>Event Management System</h1>
        <Routes>
          <Route path="/" element={<EventList />} exact />
          <Route path="/add-event" element={<AddEventForm />} />
          <Route path="/edit-event/:eventId" element={<EditEventForm />} />
          {/* No dedicated route for delete as it might be an action within EventList or EditEventForm */}
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
